css:
.github-StubItem-git-tab-controller {
  flex: 1;
  display: flex;
}
.github-PanelEtchWrapper {
  flex: 1;
  display: flex;
  min-width: 0;
}
.github-Panel {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", "Roboto", "Oxygen", "Ubuntu", "Cantarell", "Fira Sans", "Droid Sans", "Helvetica Neue", sans-serif;
  font-size: 12px;
  color: #212529;
  -webkit-user-select: none;
  cursor: default;
}
.github-Panel.no-repository {
  padding: 30px;
  text-align: center;
}
.github-Panel.is-loading {
  color: #868e96;
}
.github-Panel.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Panel.no-repository > * {
  margin: 10px 0;
}
.github-Panel.no-repository .git-logo-path {
  fill: #b4b5b6;
}
atom-dock.bottom .github-Panel {
  flex-direction: row;
}
atom-dock.bottom .github-StagingView {
  flex-direction: row;
  flex: 2;
}
atom-dock.bottom .github-StagedChanges {
  border-left: 1px solid #f1f3f5;
  border-right: 1px solid #f1f3f5;
}
atom-dock.bottom .github-StagingView-group:first-child .github-StagingView-header {
  border-top: 1px solid #f1f3f5;
}
atom-dock.bottom .github-CommitView {
  flex: 1;
}
